import React from 'react';
import { Menu } from 'semantic-ui-react';
import { Link } from '../routes';

export default () => {
  return (
    <Menu style={{ marginTop: '15px'}}>

      <Link route="/">
        <a>CrowdCoin</a>
      </Link>

      <Menu.Menu position="right">

      <Menu.Item>
        Campaign
      </Menu.Item>

      <Menu.Item>
        +
      </Menu.Item>
      </Menu.Menu>

    </Menu>
  )
}
